import {
    AppBar, Toolbar 
} from "@material-ui/core";

function Header() {
    return(
        <div>
            <AppBar>
                <Toolbar>
                <center> <h1> Sound to hand </h1> </center>
                </Toolbar>
            </AppBar>
        </div>
    );
} export default Header;
